import React, { useState, useEffect } from 'react';
import employeeService from '../services/employeeService';
import {
  Typography,
  CircularProgress,
  TextField,
  Box,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Button,
  Divider,
} from '@mui/material';
import EditIcon from '@mui/icons-material/Edit';
import DeleteIcon from '@mui/icons-material/Delete';
import { useNavigate } from 'react-router-dom';

const EmployeeList = () => {
  const [employees, setEmployees] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [searchTerm, setSearchTerm] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    fetchEmployees();
  }, []);

  const fetchEmployees = async () => {
    try {
      setLoading(true);
      const response = await employeeService.getAllEmployees();
      setEmployees(response.data);
      setError(null);
    } catch (error) {
      setError('Failed to fetch employees. Please try again later.');
      console.error('Error fetching employees:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleDelete = async (id) => {
    try {
      await employeeService.deleteEmployee(id);
      setEmployees(employees.filter((employee) => employee.id !== id));
    } catch (error) {
      console.error('Error deleting employee:', error);
      setError('Failed to delete employee. Please try again later.');
    }
  };

  const filteredEmployees = employees.filter((employee) => {
    const searchStr = searchTerm.toLowerCase();
    return (
      employee.name.toLowerCase().includes(searchStr) ||
      employee.salary.toString().includes(searchStr) ||
      employee.department.toLowerCase().includes(searchStr)
    );
  });

  if (error) {
    return <Typography color="error">{error}</Typography>;
  }

  return (
    <Box sx={{ p: 3 }}>
      <Typography
        variant="h4"
        align="center"
        fontWeight="bold"
        gutterBottom
        sx={{ mb: 3, fontWeight: 600 }}
      >
        Employee List
      </Typography>
      <Box sx={{ display: 'flex', justifyContent: 'center', mb: 3 }}>
        <TextField
          label="Search by Name, Amount, or Department"
          variant="outlined"
          size="small"
          value={searchTerm}
          onChange={(e) => setSearchTerm(e.target.value)}
          sx={{ width: '50%' }}
        />
      </Box>
      {loading ? (
        <Box sx={{ display: 'flex', justifyContent: 'center' }}>
          <CircularProgress />
        </Box>
      ) : (
        <TableContainer component={Paper}>
          <Table sx={{ minWidth: 650 }} aria-label="employee table">
            <TableHead>
              <TableRow>
                <TableCell sx={{ border: '1px solid rgba(224, 224, 224, 1)', fontWeight: 500 }}>Name</TableCell>
                <TableCell align="left" sx={{ border: '1px solid rgba(224, 224, 224, 1)', width: '20%', fontWeight: 500 }}>Email</TableCell>
                <TableCell align="right" sx={{ border: '1px solid rgba(224, 224, 224, 1)', fontWeight: 500 }}>Department</TableCell>
                <TableCell align="right" sx={{ border: '1px solid rgba(224, 224, 224, 1)', fontWeight: 500 }}>Salary</TableCell>
                <TableCell align="center" sx={{ border: '1px solid rgba(224, 224, 224, 1)', fontWeight: 500 }}>Update</TableCell>
                <TableCell align="center" sx={{ border: '1px solid rgba(224, 224, 224, 1)', fontWeight: 500 }}>Delete</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {filteredEmployees.map((employee) => (
                <TableRow
                  key={employee.id}
                  sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                >
                  <TableCell component="th" scope="row" sx={{ border: '1px solid rgba(224, 224, 224, 1)', fontWeight: 500 }}>
                    {employee.name}
                  </TableCell>
                  <TableCell align="left" sx={{ border: '1px solid rgba(224, 224, 224, 1)', fontWeight: 500 }}>{employee.email}</TableCell>
                  <TableCell align="right" sx={{ border: '1px solid rgba(224, 224, 224, 1)', fontWeight: 500 }}>{employee.department}</TableCell>
                  <TableCell align="right" sx={{ border: '1px solid rgba(224, 224, 224, 1)', fontWeight: 500 }}>{employee.salary}</TableCell>
                  <TableCell align="center" sx={{ border: '1px solid rgba(224, 224, 224, 1)' }}>
                    <Button
                      variant="contained"
                      color="secondary"
                      onClick={() => navigate(`/edit/${employee.id}`)}
                      startIcon={<EditIcon />}
                      size="small"
                    >
                      Update
                    </Button>
                  </TableCell>
                  <TableCell align="center" sx={{ border: '1px solid rgba(224, 224, 224, 1)' }}>
                    <Button
                      variant="contained"
                      color="error"
                      onClick={() => handleDelete(employee.id)}
                      startIcon={<DeleteIcon />}
                      size="small"
                    >
                      Delete
                    </Button>
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      )}
    </Box>
  );
};

export default EmployeeList;
